import React from 'react';

function LoginConfirmation(props) {
    return (

        <div>
            {props.userAccount.map(userAccount => {
                let usernameIDK = userAccount.username;
                let passwordIDK = userAccount.password;

                if(props.username === usernameIDK){
                    if(props.password === passwordIDK){
                        let usernameChecked = props.username;
                        let passwordChecked = props.password;

                        return(
                            <div>
                                <div name="usernameMap" value={props.cred.usernameChecked} onLoad={props.inputChanged}></div>
                                <div name="passwordMap" value={props.cred.passwordChecked} onLoad={props.inputChanged}></div>
                            </div>
                        );
                    } 
                }
            })}
        </div>
    );
}

export default LoginConfirmation;
